import React from 'react';

class Logo extends React.Component {

    render() {
        return (
            <div className="ui items">
                <div className="item" style={{padding: "10px 0px 0px 5px"}}>
                    <div className="ui mini image">
                        <img alt="logo" src="favicon.ico"/>
                    </div>
                    <div className="middle aligned content" style={{padding: "7px 0px 0px 5px"}}>
                        <p className="header">Youtube TV</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Logo;
